var conns int
var k1bytes []byte
var k100bytes []byte
var response143KB []byte

func init() {
	response143KB = []byte("")

}

func randomString(n int) string {
	var letterRunes = []rune("abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789")

	b := make([]rune, n)
	for i := range b {
		b[i] = letterRunes[rand.Intn(len(letterRunes))]
	}
	return string(b)
}
func randomStringBytes(n int) []byte {
	if n == 143*1024 {
		return response143KB
	} else {
		return []byte(randomString(n))
	}
}

func payload143Kb() []byte {
	return []byte(response143KB)
}
func main() {
	var data []byte
	data1k := randomStringBytes(1 * 1024)

	ctxt := context.Background()

	http.HandleFunc("/", func(w http.ResponseWriter, r *http.Request) {
		conns++

		defer r.Body.Close()

		datasizeStr := r.URL.Query().Get("s")

		dataSize, err := strconv.Atoi(datasizeStr)

		if err != nil {
			log.Printf("Erroneous value for size , defaulting to 1kb : %v", err.Error())
			data = data1k
		} else {
			data = randomStringBytes(dataSize * 1024)
		}

		//switch datasize {
		//case "100":
		//      data = data100k
		//default:
		//      data = data1k
		//}

		ds := r.URL.Query().Get("d")
		d, err := strconv.Atoi(ds)
		/*if err != nil {
		        d = 100
		}*/
		if err == nil {
			time.Sleep(time.Duration(d) * time.Millisecond)
		}

		w.Write(data)

		conns--
	})

	go ShowConns()

	go func() {
		log.Fatal(http.ListenAndServe(":"+getHTTPPort(), nil))
	}()

	//go func() {
	//      log.Fatal(http.ListenAndServeTLS(":"+getHTTPSPort(), "server.crt", "server.key", nil))
	//}()
	fmt.Println("listening...")
	<-ctxt.Done()
}

//ShowConns shows connections count
func ShowConns() {
	for {
		if conns > 0 {
			// fmt.Printf("conns: %d\n", conns)
		}
		time.Sleep(10 * time.Millisecond)
	}
}

func getHTTPPort() string {
	port := os.Getenv("PORT")
	if port == "" {
		port = "9090"
	}
	return port
}

func getHTTPSPort() string {
	port := os.Getenv("SECURE_PORT")
	if port == "" {
		port = "9443"
	}
	return port
}
